              <div class="stl_01" style="top: 0.5991em; left:11.9017em;"><span class="stl_07 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0364em;">施耐德 </span><span class="stl_10 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0364em;">PLC</span><span class="stl_07 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0364em;">通过以太网连接的远程维护操作 &nbsp;</span></div>
              <div class="stl_01" style="top: 3.3271em; left:7.502em;"><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0201em;">施耐德 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0201em;">PLC</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0201em;">设备通过以太网连接，由 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0201em;">SS700</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0201em;">进行远程维护时，具体操作如下： &nbsp;</span></div>
              <div class="stl_01" style="top: 5.264em; left:7.762em;"><span class="stl_15 stl_08 stl_16" style="font-weight:bold;">第一部分：</span><span class="stl_17 stl_08 stl_16" style="font-weight:bold;">PLC</span><span class="stl_15 stl_08 stl_16" style="font-weight:bold;">设备往云管理平台的添加 &nbsp;</span></div>
              <div class="stl_01" style="top: 7.2288em; left:7.482em;z-index:100; "><span class="stl_11 stl_12 stl_18">※第一步：进入管理后台之后点击“设备</span><span class="stl_14 stl_12 stl_18">&gt;</span><span class="stl_11 stl_12 stl_18">以太网”。 &nbsp;</span></div>
              <div class="stl_01" style="top: 18.6288em; left:7.482em;"><span class="stl_11 stl_12 stl_19">※第二步：输入</span><span class="stl_11 stl_12 stl_19" style="word-spacing:0.0389em;">&nbsp;</span><span class="stl_14 stl_12 stl_19" style="word-spacing:0.0389em;">PLC</span><span class="stl_11 stl_12 stl_19" style="word-spacing:0.0389em;">设备的</span><span class="stl_11 stl_12 stl_19" style="word-spacing:0.0539em;">&nbsp;</span><span class="stl_14 stl_12 stl_19" style="word-spacing:0.0539em;">IP</span><span class="stl_14 stl_12 stl_19" style="word-spacing:-0.1986em;">&nbsp;</span><span class="stl_11 stl_12 stl_19" style="word-spacing:-0.1986em;">地址，再输入端口号</span><span class="stl_11 stl_12 stl_19" style="word-spacing:0.0515em;">&nbsp;</span><span class="stl_14 stl_12 stl_19" style="word-spacing:0.0515em;">502</span><span class="stl_11 stl_12 stl_19" style="word-spacing:0.0515em;">，然后点击“添加”按钮、成功显示产品 &nbsp;</span></div>
              <div class="stl_01" style="top: 19.9288em; left:5.732em;"><span class="stl_11 stl_12 stl_20">后再点击“同步到云端”按钮，设备添加成功。 &nbsp;</span></div>
              <div class="stl_01" style="top: 31.3681em; left:7.762em;"><span class="stl_15 stl_08 stl_21" style="font-weight:bold;">第二部分：远程维护的操作 &nbsp;</span></div>
              <div class="stl_01" style="top: 33.4113em; left:8.072em;"><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.0271em;">※第一步：通过 </span><span class="stl_14 stl_12 stl_22" style="word-spacing:-0.0271em;">IE</span><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.0271em;">浏览器访问 </span><a href="http://www.jzt2025.comè¿å¥ææºé2025/" target="_blank"><span class="stl_14 stl_12 stl_22" style="word-spacing:-0.0271em;">www.jzt2025.com</span></a><a href="http://www.jzt2025.comè¿å¥ææºé2025/" target="_blank"><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.0271em;">进入极智通 </span></a><a href="http://www.jzt2025.comè¿å¥ææºé2025/" target="_blank"><span class="stl_14 stl_12 stl_22" style="word-spacing:-0.0271em;">2025</span></a><a href="http://www.jzt2025.comè¿å¥ææºé2025/" target="_blank"><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.0271em;">云管</span></a><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.0271em;">理平台，选择远程 </span><span class="stl_14 stl_12 stl_22" style="word-spacing:-0.0271em;">PLC</span><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.0271em;">连 &nbsp;</span></div>
              <div class="stl_01" style="top: 34.9113em; left:6.322em;z-index:282; "><span class="stl_11 stl_12 stl_23" style="word-spacing:0.0518em;">接的 </span><span class="stl_14 stl_12 stl_23" style="word-spacing:0.0518em;">SS700</span><span class="stl_11 stl_12 stl_23" style="word-spacing:0.0518em;">，点击右边齿轮再点击“开始远程维护”。 &nbsp;</span></div>
              <div class="stl_01" style="top: 43.8129em; left:7.482em;"><span class="stl_11 stl_12 stl_24" style="word-spacing:0.0045em;">※第二步：打开施耐德 </span><span class="stl_14 stl_12 stl_24" style="word-spacing:0.0045em;">PLC</span><span class="stl_11 stl_12 stl_24" style="word-spacing:0.0045em;">编程软件 </span><span class="stl_14 stl_12 stl_24" style="word-spacing:0.0045em;">SoMachine</span><span class="stl_11 stl_12 stl_24" style="word-spacing:0.0045em;">，创建新项目，出现如下页面请点击“管理 &nbsp;</span></div>
              <div class="stl_01" style="top: 45.1129em; left:5.732em;"><span class="stl_11 stl_12 stl_25">设备”按钮。 &nbsp;</span></div>
              <div class="stl_01" style="top: 68.2151em; left:7.482em;"><span class="stl_11 stl_12 stl_26" style="word-spacing:0.0087em;">※第三步：在跳出的对话框中，先点击“</span><span class="stl_14 stl_12 stl_26" style="word-spacing:0.0087em;">Logic Controller</span><span class="stl_11 stl_12 stl_26" style="word-spacing:0.0087em;">”再选定要远程</span><span class="stl_11 stl_12 stl_26" style="word-spacing:0.1894em;">&nbsp;</span><span class="stl_14 stl_12 stl_26" style="word-spacing:0.1894em;">PLC</span><span class="stl_14 stl_12 stl_26" style="word-spacing:-0.057em;">&nbsp;</span><span class="stl_11 stl_12 stl_26" style="word-spacing:-0.057em;">的型号导 &nbsp;</span></div>
